import React from "react";
import Avatar from "@mui/material/Avatar";
import { Link } from "react-router-dom";
import { Button, IconButton } from "@mui/material";
import SettingsIcon from "@mui/icons-material/Settings";
import EditIcon from "@mui/icons-material/Edit";
import PhotoCameraIcon from "@mui/icons-material/PhotoCamera";
import BoltIcon from "@mui/icons-material/Bolt";

import "./Profile.css";

function Profile({ name, age, profilePic, job }) {
  return (
    <div class="profile">
      <Avatar
        sx={{ height: "90px", width: "90px" }}
        className="profile__image"
        alt={name}
        src={profilePic}
      />
      <div class="profile__info">
        <h2>
          {name}, {age}
        </h2>
        <p>{job}</p>
      </div>
    </div>
  );
}

function Profiles() {
  return (

    <div class="profiles__page">
      <svg class = "profile__svg" id="wave" style="transform:rotate(0deg), scale(1.5); transition: 0.3s" viewBox="0 0 1440 490" version="1.1" xmlns="http://www.w3.org/2000/svg"><defs><linearGradient id="sw-gradient-0" x1="0" x2="0" y1="1" y2="0"><stop stop-color="rgba(243, 106, 62, 1)" offset="0%"></stop><stop stop-color="rgba(255, 179, 11, 1)" offset="100%"></stop></linearGradient></defs><path style="transform:translate(0, 0px); opacity:1" fill="url(#sw-gradient-0)" d="M0,49L120,98C240,147,480,245,720,236.8C960,229,1200,114,1440,98C1680,82,1920,163,2160,212.3C2400,261,2640,278,2880,269.5C3120,261,3360,229,3600,212.3C3840,196,4080,196,4320,220.5C4560,245,4800,294,5040,310.3C5280,327,5520,310,5760,318.5C6000,327,6240,359,6480,351.2C6720,343,6960,294,7200,228.7C7440,163,7680,82,7920,81.7C8160,82,8400,163,8640,187.8C8880,212,9120,180,9360,171.5C9600,163,9840,180,10080,187.8C10320,196,10560,196,10800,163.3C11040,131,11280,65,11520,73.5C11760,82,12000,163,12240,196C12480,229,12720,212,12960,220.5C13200,229,13440,261,13680,302.2C13920,343,14160,392,14400,375.7C14640,359,14880,278,15120,253.2C15360,229,15600,261,15840,294C16080,327,16320,359,16560,310.3C16800,261,17040,131,17160,65.3L17280,0L17280,490L17160,490C17040,490,16800,490,16560,490C16320,490,16080,490,15840,490C15600,490,15360,490,15120,490C14880,490,14640,490,14400,490C14160,490,13920,490,13680,490C13440,490,13200,490,12960,490C12720,490,12480,490,12240,490C12000,490,11760,490,11520,490C11280,490,11040,490,10800,490C10560,490,10320,490,10080,490C9840,490,9600,490,9360,490C9120,490,8880,490,8640,490C8400,490,8160,490,7920,490C7680,490,7440,490,7200,490C6960,490,6720,490,6480,490C6240,490,6000,490,5760,490C5520,490,5280,490,5040,490C4800,490,4560,490,4320,490C4080,490,3840,490,3600,490C3360,490,3120,490,2880,490C2640,490,2400,490,2160,490C1920,490,1680,490,1440,490C1200,490,960,490,720,490C480,490,240,490,120,490L0,490Z"></path></svg>
      <Profile
        name="Harry Alpha"
        age="23"
        profilePic="http://www.venmond.com/demo/vendroid/img/avatar/big.jpg"
        job="Front-End Developer at Tinder"
      />
      <div className="profile__buttons">
        <div className="profile__buttonsTop">
          <div class="profile__button">
            <IconButton className="profile__settings">
              <SettingsIcon fontSize="large" />
            </IconButton>
            <label>Settings</label>
          </div>

          <div class="profile__button">
            <IconButton className="profile__edit">
              <EditIcon fontSize="large" />
            </IconButton>
            <label>Edit Profile</label>
          </div>
        </div>

        <div className="profile__buttonsBottom">
          <div class="profile__button">
            <IconButton sx = {{fill: "linear-gradient(40deg, #FD297B, #FF5864, #FF655B)"}} className="profile__camera">
              <PhotoCameraIcon fontSize="large" />
            </IconButton>
            <label>Add Media</label>
          </div>
        </div>
      </div>

      <div className="profile__aspects">
        <div className="profile__upgrades">
          <BoltIcon fontSize="large" className="profile__bolt" />
          <h2>Get Matches Faster</h2>
        </div>
        <p>Boost your profile once per month!</p>
        <Button>GET TINDER PLUS</Button>
      </div>
    </div>
  );
}

export default Profiles;
